import React from "react";
import './post.css'
export default function Post(props){
  let post = props.post
  // let idUser = post.userId;
  let img = '../public/speech-bubble.png'
  return(
    <div className="postText">
      <li className="title">{post.title}</li>
      <li>{post.body}</li>
      <hr></hr>
      <div>
        <h2> Reacciones al post</h2>
        <img src={img}></img>
      </div>
    </div>
  );
}
